import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { Grid, makeStyles } from '@material-ui/core';

import CompositionInfo from './CompositionInfo';
// import Emails from './Emails';
// import Invoices from './Invoices';
// import OtherActions from './OtherActions';

const useStyles = makeStyles(() => ({
  root: {}
}));

function Details({ className, compositions, ...rest }) {
  const classes = useStyles();

  return (
    <Grid
      className={clsx(classes.root, className)}
      container
      spacing={3}
      {...rest}
    >
      {compositions.map(composition => (
        <Grid item lg={4} md={6} xl={3} xs={12} key={composition.id}>
          <CompositionInfo composition={composition} />
        </Grid>
      ))}

      {/* <Grid item lg={4} md={6} xl={3} xs={12}>
        <CustomerInfo compositions={compositions} />
      </Grid>
      <Grid item lg={4} md={6} xl={3} xs={12}>
        <Invoices compositions={compositions} />
      </Grid>
      <Grid item lg={4} md={6} xl={3} xs={12}>
        <Emails />
      </Grid>
      <Grid item lg={4} md={6} xl={3} xs={12}>
        <OtherActions />
      </Grid> */}
    </Grid>
  );
}

Details.propTypes = {
  className: PropTypes.string,
  compositions: PropTypes.array.isRequired
};

export default Details;
